import Svg, { Path } from 'react-native-svg';
/* SVGR has dropped some elements not supported by react-native-svg: style */

export const IconHomeSolid = props => (
    <Svg
    width={22}
    height={22}
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    {...props}
  >
    <Path
      d="M11 1.1 0 11h3.3v8.8h5.4V13h4.5v6.8h5.5V11H22z"
      fill={Colors.HERO_BLUE}
    />
  </Svg>
);
